import * as types from "./actionsType";

const initialState = { users: [], user: {}, loading: false };

const usersReducers = (state = initialState, action) => {
  switch (action.type) {
    case types.GET_USERS:
      return {};
    default:
      return state;
  }
};

export default usersReducers;
